import { useState, useEffect } from 'react';
import { TreeTable } from 'primereact/treetable';
import { Column } from 'primereact/column';
import { params } from './params'; // Adjust this import as needed

export default function FullParameterList({ param_type }) {
    const [keyValuePairs, setKeyValuePairs] = useState([]);
    const [loading, setLoading] = useState(true);
    const [expandedRowKeys, setExpandedRowKeys] = useState({}); // Track expanded rows

    useEffect(() => {
        setLoading(true); // Set loading to true each time param_type changes

        if (param_type === 'full') {
            const data = params.getFullParams();
            console.log('Fetched Data:', data);  // Log the fetched data

            const transformedData = transformToTree(data[0]);
            console.log('Transformed Data:', transformedData);  // Log the transformed data

            setKeyValuePairs(transformedData);
            setLoading(false);
        } else {
            setKeyValuePairs([]);
            setLoading(false);
        }
    }, [param_type]);

    const transformToTree = (data) => {
        return Object.keys(data).map((key) => ({
            key: key,
            label: key, // Set 'label' as the key
            data: data[key],
            icon: 'pi pi-fw pi-file', // Adjust the icon as needed
            children: generateChildren(key, data[key]) // Return an array for children
        }));
    };

    const generateChildren = (parentKey, parentValue) => {
        if (typeof parentValue === 'object' && !Array.isArray(parentValue)) {
            return Object.keys(parentValue).map((key) => ({
                key: `${parentKey}-${key}`, // Create a unique key
                label: key,
                data: parentValue[key],
                icon: 'pi pi-fw pi-file', // Adjust the icon as needed
                children: generateChildren(key, parentValue[key]) // Recursively generate children
            }));
        }
        return [];
    };

    // Customize how children are displayed
    const rowExpansionTemplate = (node) => {
        return (
            <div>
                <strong>Details:</strong>
                <pre>{JSON.stringify(node.data.value, null, 2)}</pre>
            </div>
        );
    };

    // Update the expandedRowKeys state when rows are toggled
    const onRowToggle = (e) => {
        setExpandedRowKeys(e.value);
    };

    return (
        <div className="card">
            {loading ? (
                <p>Loading data...</p>
            ) : keyValuePairs.length === 0 ? (
                <p>No data available.</p>
            ) : (
                <TreeTable
                    value={keyValuePairs}
                    tableStyle={{ minWidth: '50rem' }}
                    paginator
                    rows={10}
                    expandedRowKeys={expandedRowKeys} 
                    onRowToggle={onRowToggle} // Handle row toggle action
                    rowExpansionTemplate={rowExpansionTemplate} // Define how to expand rows
                >
                    <Column field="label" header="Name" />
                    <Column field="data" header="Value" />
                    <Column field="parent" header="Parent" />
                </TreeTable>
            )}
        </div>
    );
}
